SELECT RTRIM(AccountNumber) AccountNumber, AccountUUID, TranID, TranTime, Amount TransactionAmount, FINAL_INT_CR_AMT
FROM ##PostWithInterestCredit

SELECT * FROM ##TempRecords

SELECT RTRIM(T1.AccountNumber) AccountNumber, T2.AccountUUID, T2.TranID, T2.TranTime, T2.Amount TransactionAmount, T2.FINAL_INT_CR_AMT, T1.Amount PostedAmount
FROM ##TempRecords T1
